import React from "react";
import Typography from '@material-ui/core/Typography';

const Accommodation = () => {
    return (
        <>
            <h3> Step 4 - Find Accommodation </h3>
            <Typography>
                I can't provide all but you can find most of the student hostels at <a href='https://www.studium.at/studentenheime'>https://www.studium.at/studentenheime</a>.
                <br />
                Please follow the application process of each of the housing. Mostly they ask for <strong>600 to 1000 Euros</strong> deposit and then you get contract to present at embassy at the time of residence permit application.
            </Typography>
        </>
    );
}
export default Accommodation;
